// import logo from './logo.svg';
import './App.css';
import Navbar from './pages/Navbar';
import inputValue from './pages/Navbar/useState';
import News from './pages/News';

import {
  BrowserRouter as Router,
  Route,
  Routes
} from "react-router-dom";


function App(props) {
  let country='in'


  return (
    <div>
      <Router>
        <Navbar/>
        <Routes>
          <Route exact path='/' element={<News key="general"   category="general" country={country}/>} />
          <Route exact path='/business' element={<News key="business"   category="business"country={country} />} />
          <Route exact path='/entertainment' element={<News key="entertainment"   category="entertainment" country={country}/>} />
          <Route exact path='/sports' element={<News key="sports"   category="sports" country={country}/>} />
          <Route exact path='/health' element={<News key="health"   category="health" country={country}/>} />
          <Route exact path='/science' element={<News key="science"   category="science" country={country}/>} />
          <Route exact path='/technology' element={<News key="technology"   category="technology" country={country}/>} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
